            if (code < 194560) // '\U0002A6D7' <= code <= '\U0002F7FF'
              return (sbyte)9;
            else // '\U0002F800' <= code <= '\U0010FFFF'
              if (code < 195102) // '\U0002F800' <= code <= '\U0002FA1D'
                return (sbyte)7;
              else // '\U0002FA1E' <= code <= '\U0010FFFF'
                return (sbyte)9;
    }
#endregion


    static sbyte Map(int code)
    { 
        if (code <= 65535)
            return map[code / 256][code % 256];
        else
            return MapC(code);
    }

    static Table[] NxS = new Table[17] {
/* NxS[   0] */ new Table(0, 0, 0, null), // Shortest string ""
/* NxS[   1] */ // Shortest string "("
      new Table(1, 3, 1, new sbyte[] {-1, 1, -1}),
/* NxS[   2] */ // Shortest string "<"
      new Table(1, 4, -1, new sbyte[] {6, -1, -1, 7}),
/* NxS[   3] */ // Shortest string "\t"
      new Table(1, 3, 1, new sbyte[] {-1, 3, 14}),
/* NxS[   4] */ // Shortest string ">"
      new Table(3, 1, -1, new sbyte[] {5}),
/* NxS[   5] */ new Table(0, 0, -1, null), // Shortest string ">>"
/* NxS[   6] */ // Shortest string "<<"
      new Table(2, 1, -1, new sbyte[] {6}),
/* NxS[   7] */ new Table(0, 0, -1, null), // Shortest string "<("
/* NxS[   8] */ // Shortest string ""
      new Table(5, 6, 9, new sbyte[] {10, 16, 9, 9, 9, 15}),
/* NxS[   9] */ // Shortest string "<"
      new Table(5, 6, 9, new sbyte[] {-1, -1, 9, 9, 9, -1}),
/* NxS[  10] */ new Table(0, 0, -1, null), // Shortest string "|"
/* NxS[  11] */ // Shortest string "%A"
      new Table(7, 2, -1, new sbyte[] {11, 11}),
/* NxS[  12] */ new Table(0, 0, -1, null), // Shortest string ""
/* NxS[  13] */ // Shortest string ""
      new Table(1, 3, 1, new sbyte[] {2, 3, 4}),
/* NxS[  14] */ // Shortest string "\t>"
      new Table(3, 1, -1, new sbyte[] {5}),
/* NxS[  15] */ // Shortest string ""
      new Table(3, 1, -1, new sbyte[] {12}),
/* NxS[  16] */ // Shortest string "%"
      new Table(7, 1, -1, new sbyte[] {11}),
    };

int NextState() {
    if (code == ScanBuff.EndOfFile)
        return eofNum;
    else
        unchecked {
            int rslt;
            int idx = Map(code) - NxS[state].min;
            if (idx < 0) idx += 10;
            if ((uint)idx >= (uint)NxS[state].rng) rslt = NxS[state].dflt;
            else rslt = NxS[state].nxt[idx];
            return rslt;
        }
}

